import React from "react";
import "./App.css";

import List from "./componets/List";

class App extends React.Component {
  state = {
    user1: [
      {
        text: "foo",
      },
      {
        text: "bar",
      },
      {
        id: 0,
      },
    ],
    user2: [
      {
        text: "foo",
      },
      {
        text: "bar",
      },
    ],
    user3: [
      {
        text: "foo",
      },
      {
        text: "bar",
      },
    ],
    user4: [
      {
        text: "foo",
      },
      {
        text: "bar",
      },
    ],
    input: "",
  };

  moveToNext = () => {};

  render() {
    return (
      <div className="App">
        <div className="container">
          <div>
            <div className="user1">
              <h2 className="name">Winnie</h2>
            </div>
            <List blocktext={this.state.user1} />
          </div>
          <div>
            <div className="user2">
              <h2 className="name">Bob</h2>
            </div>
            <List blocktext={this.state.user2} />
          </div>
          <div>
            <div className="user3">
              <h2 className="name">Thomas</h2>
            </div>
            <List blocktext={this.state.user2} />
          </div>
          <div>
            <div className="user4">
              <h2 className="name">George</h2>
            </div>
            <List blocktext={this.state.user2} />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
